export default {
	data:{},

	start () {
		qlc.start();
		qlc.setField("tecla", 0);
		qlc.setField("numero_aparecido", 10);
	},

	questionScript () {
		// El nmero base es '987654321'
		let baseNumero = "987654321";
		let multiploDe = 11;
		let resto = 3;

		for (let index = 0; index < baseNumero.length; index++) {
			for (let replacement = 1; replacement <= 9; replacement++) {
				// Convertimos el dgito a entero para hacer operaciones
				let digitoInt = parseInt(baseNumero[index], 10); 
				// Nos aseguramos de que no estemos reemplazando el dgito por s mismo
				// y que al cambiar el dgito, la suma de los dgitos se incremente en 3
				if (replacement !== digitoInt) {
					// Creamos un nuevo nmero con el dgito reemplazado
					let nuevoNumero = baseNumero.substring(0, index) + replacement.toString() + baseNumero.substring(index + 1);
					// Convertimos el nuevo nmero a entero para hacer las verificaciones
					let nuevoNumeroInt = parseInt(nuevoNumero, 10);
					// Verificamos si el nuevo nmero es divisible por 11 y deja residuo de 3 al dividir por 9
					if (nuevoNumeroInt % multiploDe === 0 && nuevoNumeroInt % 9 === resto) {
						qlc.log(`El nmero modificado es: ${nuevoNumero}`);
						qlc.setResult("numero_aparecido", nuevoNumero);
						qlc.setResult("tecla", digitoInt);
						qlc.log(`El nmero modificado es: ${qlc.getResult("tecla")}`);
					}
				}
			}
		}

	}

}

